import './Carousel.css'
import image from '../products/07.jpg'

const title = 'LiteCnC';
class ProductList extends Component {
    render() {
        return (
            <React.Fragment>

            <Helmet>
                <title>LiteCnC</title>
            </Helmet>
                {/* Carousel or slider */}
         <div className='home-container'>
                <img className='home-image' src={image} alt="car" width="100%"/>

                <div class="centered">
                    <h1 className='home-title'>LiteCnC</h1>
                    <p className='paragraph'>This is my favorite app</p>
                    <button className='book-now'>Book Now</button>
                </div>
        </div>


                {/* Content found on a landing page after slider */}

            </React.Fragment>

        );
    }
}

export default ProductList;
